import React, { Component } from 'react';
import './CRUDAdmin.css';
import { useNavigate } from 'react-router-dom';

function vistaTorneos() {
    const navigate = useNavigate();
    const handleLogout = () => {
        localStorage.clear();
        navigate('/');
    };


    return (
        <>
          <Container>
            <br />
            <div className="d-flex justify-content-between">
                <Button style={{ marginRight: '10px' }}  color="success" onClick={() => this.mostrarModalInsertar()}>Nuevo administrador</Button>
                <Button style={{ marginRight: '10px' }}  color="success" onClick={() => this.mostrarTodosTorneos()}>Ver Torneos Actuales</Button>
            </div>
            <div className="barraBusqueda">
              <input
                type="text"
                placeholder="Buscar"
                className="textField"
                name="busqueda"
                value={this.state.busqueda}
                onChange={this.handleChangeBuscar}
              />
              <Button className="btnBuscar" color="primary">Buscar</Button>
            </div>
            <br />
            <br />
            <Table>
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Nombre</th>
                  <th>Apellido</th>
                  <th>Email</th>
                  <th>Acci√≥n</th>
                </tr>
              </thead>

              <tbody>
                {this.state.data.map((dato) => (
                  <tr key={dato.id}>
                    <td>{dato.id}</td>
                    <td>{dato.nombre}</td>
                    <td>{dato.apellido}</td>
                    <td>{dato.email}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </Container>

          </>
    );
}

export default vistaTorneos;
